import Button from "./form-components/Button";

export default class Chicks extends Component {
    render() {
            return (
                <Fragment>
                    <h2>Chicks</h2>

                    <div className="list-group">
                        <Button className="button-64">
                            Kuroiler
                        </Button>
                    </div>
                </Fragment>
            );
        }
}
